import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./pages/home";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="*" element={<ErrorPage />}></Route>
        <Route path="/" element={<Home />}></Route>

      </Routes> 
    </BrowserRouter>
  );
}

export default App;
